import React from "react";

function GuessInput() {
  return (
    <>
      <form className="guess-input-wrapper">
        <label htmlFor="guess-input">Enter guess:</label>
        <input
          id="guess-input"
          value={guessed}
          type="text"
          maxLength={5}
          minLength={5}
          onChange={(event) => setGuessed(event.target.value.toUpperCase())}
        />
      </form>
      <p>
        <strong>Current value:</strong>
        {guessed || "(empty)"}
      </p>
    </>
  );
}

export default GuessInput;
